import '../custom.scss'
import '../css/Welcome.css';
import '../css/footer.css';
function Footer(){
    return (
        <>
            <footer>
                <div className='footer'>
                    <h1>ヤフ次魚恋せさとフ。</h1>
                    <p>究キ協江ク古朝ぶめ施夜読京ヌ初相で極化毎マニテラ止民チハシヱ絶流ちべし触自下ツハクム委話ぱれ世3更ツ対検沖鹿きとら。西り案価よ指利チ報浪びぼ択穴上とスそび感録だざ索36潤まりだ違町取こぞのス生担アツ体経アヲヘ発原基締り。発タトテ家望温ク止28記ハタレ予井ぴ必像ユ野美とふ停設み望4一観カチユ経社ニトコツ毎員ニ曲気ラ自問レつ掲先び。</p>
                </div>
                <div id='footer'></div>
            </footer>
        </>
);
}

export default Footer;
